import { useState } from "react";


function SearchBar(props) {

    const [FoodName, SetFoodName] = useState("");

    const searchButtonPressed = () => { props.callback({Name:FoodName}) };




    return (
        <div className="container">
            <h2 className = "red">Search for a food</h2>
            <form>
                <div className=""></div>
                <label htmlFor="name_field">Food Name: </label>
                <input id="name_field" className="form-control" type="text" value={FoodName} onChange={(e) => SetFoodName(e.target.value)} />
                <div className="row mt-3">
                <button type="button" onClick={searchButtonPressed}>Search</button>
                </div>

            </form>
        </div>
    )
}

export default SearchBar;
